import React from "react";

import { Wrapper, Content } from "./HeroImage.styles.js";


const HeroImage = ({tracks}) => (


    <Wrapper>
      <Content>
        <img/>
        <p></p>
        <h1>Title</h1>
        <p>user name</p>
        <p>number of songs</p>
        <p>playlist duration</p>
        {tracks.tracks.map((track, i) => (
      <li key={i}>
        <h3>{track.track.name}</h3>
        <h3>{track.track.album.name}</h3>
          <div>
          {track.track.artists.map((artist, i) => (
            <span key={i}>
            {artist.name}
            </span>
                  ))}
                </div>
      </li>
      ))}
      </Content>
    </Wrapper>
  );

  export default HeroImage;
